export default function ProblemBox(props){

    let[message, setMessage] = useState(props.point);
    function clues(){
        alert(props.question);
    }
    return(
        <div>
            <div onClick={clues}>
                <h1>{props.point}</h1>
            </div>

        </div>
    )
}
